import React from "react";
import { Link } from "react-router-dom";
import useFetch from "./hooks/useFetch";
import './Cities.css';

const Cities = () => {
  const data = useFetch("https://interview-server-2022.boadler.repl.co/cities");
  // console.log(data)
  if (data.isLoading) {
    return <div>Loading...</div>;
  }
  if (data.error) {
    return <div>Sorry, something went wrong :</div>
  }
  // const { cities } = data.response;
  const city = data.response;
  return (
    <div className="App">
      <ul>
        <li><Link to="/restaurants"><button>{city[0]}</button></Link></li>
        <li><button>{city[1]}</button></li>
        <li><button>{city[2]}</button></li>
        <li><button>{city[3]}</button></li>
        <li><button>{city[4]}</button></li>
        <li><button>{city[5]}</button></li>
        <li><button>{city[6]}</button></li>
        <li><button>{city[7]}</button></li>
        <li><button>{city[8]}</button></li>
        <li><button>{city[9]}</button></li>
        <li><button>{city[10]}</button></li>
        <li><button>{city[11]}</button></li>
      </ul>

    </div>

  );
};

export default Cities;
